using System;
using Status;
using Google.Protobuf;

namespace gRPCDemo
{
    public class StatusData
    {
        public StatusData()
        {
        }
        public StatusResponse GetStatus(StatusRequest request)
        {
            StatusResponse resp = new StatusResponse();
            switch(request.RequestType)
            {
                case 1:
                    resp.StatusCode = 100;
                    resp.StatusMessage = "Hallo Welt";
                    break;
                case 2:
                    resp.StatusCode = 200;
                    resp.StatusMessage = "Foo";
                    resp.Payload = ByteString.FromBase64("");
                    break;
                default:
                    resp.StatusCode = 500;
                    resp.StatusMessage = "Request Type not found";
                    break;
            }
            return resp;
        }
    }
}
